import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { PodData } from '../types';
import { getPodTrend, isMetricBreached } from '../utils/helpers';
import { THRESHOLDS } from '../utils/constants';
import ChatBot from '../components/ChatBot';

const PodDetail: React.FC = () => {
  const { podId } = useParams<{ podId: string }>();
  const navigate = useNavigate();
  const [podTrend, setPodTrend] = useState<PodData[]>([]);
  const [currentPod, setCurrentPod] = useState<PodData | null>(null);
  const [loading, setLoading] = useState(true);
  const [chatOpen, setChatOpen] = useState(false);

  useEffect(() => {
    const fetchPodData = async () => {
      try {
        const response = await fetch('/data/pods.json');
        const data = await response.json();
        const trend = getPodTrend(data, podId!);
        setPodTrend(trend);
        setCurrentPod(trend[0] || null);
      } catch (error) {
        console.error('Error fetching pod data:', error);
      } finally {
        setLoading(false);
      }
    };

    if (podId) {
      fetchPodData();
    }
  }, [podId]);

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-instamart-blue mx-auto mb-4"></div>
          <p className="text-gray-600">Loading pod details...</p>
        </div>
      </div>
    );
  }

  if (!currentPod) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <p className="text-gray-600">Pod not found</p>
          <button
            onClick={() => navigate('/')}
            className="mt-4 px-4 py-2 bg-instamart-blue text-white rounded-lg"
          >
            Back to Dashboard
          </button>
        </div>
      </div>
    );
  }

  const o2harBreached = isMetricBreached('o2har', currentPod.o2har);
  const unserviceabilityBreached = isMetricBreached('unserviceability', currentPod.unserviceability);

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-white shadow-sm border-b border-gray-200">
        <div className="max-w-4xl mx-auto px-4 py-4">
          <div className="flex items-center justify-between">
            <div>
              <button
                onClick={() => navigate('/')}
                className="text-instamart-blue hover:text-blue-600 mb-2 flex items-center"
              >
                ← Back to Dashboard
              </button>
              <h1 className="text-2xl font-bold text-gray-900">{currentPod.pod_name}</h1>
              <p className="text-sm text-gray-600">{currentPod.zone}, {currentPod.city}</p>
            </div>
            <div className={`w-4 h-4 rounded-full ${(o2harBreached || unserviceabilityBreached) ? 'bg-instamart-red' : 'bg-instamart-green'}`}></div>
          </div>
        </div>
      </div>

      <div className="max-w-4xl mx-auto px-4 py-6">
        {/* Current Metrics */}
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">Current Metrics</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="text-center p-4 border rounded-lg">
              <p className="text-sm text-gray-600 mb-2">O2HAR</p>
              <p className={`text-3xl font-bold ${o2harBreached ? 'text-instamart-red' : 'text-instamart-green'}`}>
                {currentPod.o2har}
              </p>
              <p className="text-xs text-gray-500">Threshold: {THRESHOLDS.O2HAR}</p>
              {o2harBreached && (
                <p className="text-xs text-instamart-red mt-1">⚠️ Threshold Breached</p>
              )}
            </div>
            <div className="text-center p-4 border rounded-lg">
              <p className="text-sm text-gray-600 mb-2">Unserviceability</p>
              <p className={`text-3xl font-bold ${unserviceabilityBreached ? 'text-instamart-red' : 'text-instamart-green'}`}>
                {currentPod.unserviceability}%
              </p>
              <p className="text-xs text-gray-500">Threshold: {THRESHOLDS.UNSERVICEABILITY}%</p>
              {unserviceabilityBreached && (
                <p className="text-xs text-instamart-red mt-1">⚠️ Threshold Breached</p>
              )}
            </div>
          </div>
        </div>

        {/* 7-Day Trend */}
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">7-Day Trend</h2>
          <div className="space-y-3">
            {podTrend.map((pod, index) => (
              <div key={index} className="flex items-center justify-between p-3 border rounded-lg">
                <div className="flex items-center space-x-4">
                  <span className="text-sm text-gray-600 w-20">{pod.date}</span>
                  <div className="flex space-x-4">
                    <span className={`text-sm ${isMetricBreached('o2har', pod.o2har) ? 'text-instamart-red' : 'text-instamart-green'}`}>
                      O2HAR: {pod.o2har}
                    </span>
                    <span className={`text-sm ${isMetricBreached('unserviceability', pod.unserviceability) ? 'text-instamart-red' : 'text-instamart-green'}`}>
                      Unserviceability: {pod.unserviceability}%
                    </span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Root Causes & Recommendations */}
        {(o2harBreached || unserviceabilityBreached) && (
          <div className="bg-white rounded-lg shadow-md p-6 mb-6">
            <h2 className="text-lg font-semibold text-gray-900 mb-4">Analysis & Recommendations</h2>
            
            {/* Root Causes */}
            <div className="mb-6">
              <h3 className="text-md font-medium text-gray-900 mb-3">Root Causes</h3>
              <div className="bg-red-50 border border-red-200 rounded-lg p-4">
                <ul className="space-y-2">
                  {currentPod.root_causes.map((cause, index) => (
                    <li key={index} className="flex items-center text-red-800">
                      <span className="w-2 h-2 bg-red-500 rounded-full mr-3"></span>
                      {cause}
                    </li>
                  ))}
                </ul>
              </div>
            </div>

            {/* Recommendations */}
            <div>
              <h3 className="text-md font-medium text-gray-900 mb-3">Recommendations</h3>
              <div className="space-y-3">
                <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
                  <h4 className="font-medium text-blue-900 mb-2">Surge Pricing</h4>
                  <p className="text-blue-800">{currentPod.recommend_surge}</p>
                </div>
                <div className="bg-green-50 border border-green-200 rounded-lg p-4">
                  <h4 className="font-medium text-green-900 mb-2">DE Allocation</h4>
                  <p className="text-green-800">{currentPod.recommend_cohort_call}</p>
                </div>
              </div>
            </div>
          </div>
        )}

        {/* ChatBot */}
        <ChatBot isOpen={chatOpen} onToggle={() => setChatOpen(!chatOpen)} />
      </div>
    </div>
  );
};

